    if (RST_N != `BSV_RESET_VALUE)
      if (EN_decode_enq) $write(", ", "program_counter: ");
    if (RST_N != `BSV_RESET_VALUE)
      if (EN_decode_enq) $write("'h%h", decode_enq_fetch_1[100:37], " }");
    if (RST_N != `BSV_RESET_VALUE) if (EN_decode_enq) $write(" ");
    if (RST_N != `BSV_RESET_VALUE) if (EN_decode_enq) $write("");
    if (RST_N != `BSV_RESET_VALUE) if (EN_decode_enq) $write(" >");
    if (RST_N != `BSV_RESET_VALUE) if (EN_decode_enq) $write(" }");
    if (RST_N != `BSV_RESET_VALUE) if (EN_decode_enq) $write("\n");
  end
  // synopsys translate_on
endmodule  // mkPrf_decode

